44c\u0448\u043e\u0433\u043e \u0442\u0435\u0430\u0442\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009\" class=\"mw-redirect\" title=\"2009\">2009<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044f\">\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u0438<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D0%B4%D1%83%D0%BC\" title=\"\u0420\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\">\u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c<\/a>, \u0438\u0442\u043e\u0433\u043e\u043c \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D1%80%D0%B5%D1%82_%D0%BD%D0%B0_%D1%81%D1%82%D1%80%D0%BE%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%BC%D0%B8%D0%BD%D0%B0%D1%80%D0%B5%D1%82%D0%BE%D0%B2_%D0%B2_%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D0%B8%D0%B8\" title=\"\u0417\u0430\u043f\u0440\u0435\u0442 \u043d\u0430 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043c\u0438\u043d\u0430\u0440\u0435\u0442\u043e\u0432 \u0432 \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u0438\">\u0437\u0430\u043f\u0440\u0435\u0442 \u043d\u0430 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043c\u0438\u043d\u0430\u0440\u0435\u0442\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2016_%D0%B3%D0%BE%D0%B4\" title=\"2016 \u0433\u043e\u0434\">2016<\/a> \u2014 \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 CP-2933 \u0432\u0431\u043b\u0438\u0437\u0438 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%B5%D0%BB%D1%8C%D0%B8%D0%BD\" title=\"\u041c\u0435\u0434\u0435\u043b\u044c\u0438\u043d\">\u041c\u0435\u0434\u0435\u043b\u044c\u0438\u043d<\/a> \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043f\u0440\u0435\u0431\u044b\u0432\u0430\u043b\u043e 82 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, 27 \u0438\u0437 \u043d\u0438\u0445 - \u0438\u0433\u0440\u043e\u043a\u0438 \u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u043a\u0438 \u0431\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u043b\u0443\u0431\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D0%BF%D0%B5%D0%BA%D0%BE%D1%8D%D0%BD%D1%81%D0%B5\" title=\"\u0428\u0430\u043f\u0435\u043a\u043e\u044d\u043d\u0441\u0435\">\u0428\u0430\u043f\u0435\u043a\u043e\u044d\u043d\u0441\u0435<\/a>\u00bb. \u041f\u043e\u0433\u0438\u0431\u043b\u043e 75 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><\/ul><h2>"}